import './App.css';
import logo from './logo.png';
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";

export default function HomePage() {



const [Catagories, setProducts] = useState([]);
const [Categories, setCategories] = React.useState(null);
const [error, setError] = React.useState(null);




const render_products = (Catagories) => {


    return (

      <div className='category-section auto'>
        <h2 className="text-3xl font-extrabold tracking-tight text-gray-600 category-title">Grocery List ({Catagories.length})</h2>
        <div className="m-6 p-3 mt-10 ml-0 grid grid-cols-1 gap-y-10 gap-x-6 sm:grid-cols-2 lg:grid-cols-6 xl:gap-x-10" style={{ maxHeight: '800px', overflowY: 'scroll' }}>
          {/* Loop Catagories */}
          {Catagories.map((product, index) => (
            <div key={index} className="group relative shadow-lg">
              <div className="min-h-90 bg-gray-200 aspect-w-1 aspect-h-1 rounded-md overflow-hidden group-hover:opacity-75 lg:h-60 lg:aspect-none">

                <img

                  alt={`Product Image of ${product.Name}`}x
                  src={product.Image} 
                  className="w-full h-full object-center object-cover lg:w-full lg:h-full"

                />
              </div>
              <div className="flex justify-between p-3">
                <div>
                  <h3 className="text-sm text-gray-700">
                    <a href={regularURL + product.BaseURL}>
                      <span aria-hidden="true" className="absolute inset-0" />
                      <span style={{ fontSize: '16px', fontWeight: '600' }}>{product.Name}</span>
                    </a>
                  </h3>

                </div>
                <div className="text-sm font-medium text-green-600">Rating:  {product.Rating}</div>

              </div>
            </div>
          ))}
        </div>
      </div>
    );
  };





  // Get all Catagories.
  React.useEffect(() => {

    axios.get(baseURL).then((response) => {

      setProducts(response.data);
      console.log(Catagories);

    }).catch(error => {

      setError(error);
    });

  }, []);

  // Get Product Categories.
  React.useEffect(() => {

    axios.get(baseURL + '/categories').then((responseCategories) => {

      setCategories(responseCategories.data);
      console.log(Categories, 'Categories');

    }).catch(error => {

      setError(error);
    });

  }, []);

   // Get Product Categories.
   React.useEffect(() => {

    axios.get(baseURL + '/').then((responseCategories) => {

      setCategories(responseCategories.data);
      console.log(Categories, 'Categories');

    }).catch(error => {

      setError(error);
    });

  }, []);

  if (error) return `Error: ${error.message}`;
  if (!Catagories) return <center style={{ marginTop: '200px' }}> <img src="https://icons8.com/preloaders/preloaders/1474/Walk.gif" style={{ width: '70px' }} /> </center>;

  return (

   <div>
      <div className="bg-slate-800 p-3" style={{ width: '100%', border: '2px solid white' }}>
    <div className="flex items-center" style={{ border: '2px solid white' }}>
      <img className="h-10 mr-3" style={{ width: '100px', height: '100px', padding: '5px' }} src={logo} alt="Logo" />
      <div style={{ fontSize: '50px', fontWeight: 'bold', color: 'white', fontFamily: 'fantasy', paddingTop: '15px'}}>GroceryToGo</div>
         </div>





       <div className="navbar navbar-dark bg-dark shadow-sm">
        <div className="container" style={{ width: '100%',  }}>
            <ul className="navbar-nav" style = {{color: 'white',display: 'flex', justifyContent: 'space-between', paddingTop: '20px'}}>
              <li style={{ padding: '10px', marginLeft: '250px', fontSize:'20px'}}><a href="/">Home</a></li>
              <li style={{ padding: '10px', fontSize:'20px' }}><a href="/About">About Us</a></li>
              <li style={{ padding: '10px', fontSize:'20px' }}><a href="/Search">Search</a></li>
            </ul>
          </div>
        </div>
      </div>
      <div className="overflow-auto ml-5 p-10" style={{ flex: 1 }}>
        {render_products(Catagories)}
      </div>
    </div>
  );






}
